import React from 'react'

export const Form = () => {
  const fields = ['text', 'radio', 'checkbox'];

  return (
    <div>
      {
        fields.map((key, index) => {
          if(key === 'text') {
            <form class="row">
              <div class="mb-3">
                <label>Text</label>
                <input type="text" class="form-control" />
              </div>
            </form>
          }
        })
      }
    </div>
  )
}
